  const title = "© 2020 Kasa. All rights reserved";
  return (
    <div className="kasa-footer">
      <img className="kasa-footer-banner" src={logo_kasa} alt="Logo Kasa" />
      <h3 className="kasa-footer-title">{title}</h3>
    </div>
  );
}

export default Footer;
